If you're familiar with Wistia, you've seen their cool modal window video embeds where the video plays in an overlay on top of the web page (also known as a lightbox popover). Modal windows are great for adding extra content on a page that would normally take up a large amount of space.

They also reduce it down to a simple link which can be virtually any size you want. The best ways to use these modals are video embeds, forms for bug reporting or getting feedback on a new layout, disclaimer/disclosures, and a whole lot more.

Now that you know what a modal window is and the best time to use them, I'm going to walk you through how to make one on Hubspot's COS platform using their new custom modules feature in three simple steps.

The first thing you're going to need to do is download a modal window plugin. There are a bunch of plugins out there that do similar things, but Magnific Popup is my personal favorite due to its simplicity and usability. Smashing Magazine has a <a href="http://www.smashingmagazine.com/2013/05/02/truly-responsive-lightbox/">great article</a> about the process of making it and all of it's various features.
<h2>Step 1: Download Magnific Popup</h2>
There are two core parts to Magnific Popup, the javascript (JS) file and the stylesheet (CSS) file. To keep things simple, I've already used <a href="http://dimsemenov.com/plugins/magnific-popup/#mfp-build-tool">their build tool</a> to create the javascript file with the settings we'll need and linked both files for you to download below:

<a class="button" href="http://cdn2.hubspot.net/hubfs/57042/js/blog-tutorials/magnific-popup.js?t=1496669956379">Magnific Popup JS</a> <a class="button" href="http://cdn2.hubspot.net/hubfs/57042/js/blog-tutorials/magnific-popup.css?t=1496669956379">Magnific Popup CSS</a>
<h2>Step 2: Create The Custom Module</h2>
Go into your design manager and click on "Create New Custom Module". Call this module "Modal Popup".  If there are placeholder fields already in place, you will need to delete them on the left and delete all the code on the right.  Once that's done it should look like this:

<img class="aligncenter size-full wp-image-511" src="https://i0.wp.com/stefenphelps.com/wp-content/uploads/2015/04/modal-popup-module-1.png?fit=800%2C235&#038;ssl=1" alt="" width="800" height="235" />

Now, you'll need to create a <em>rich text field</em> called "<strong>Modal Popup</strong>" and a <em>text field</em> called "<strong>Modal Button</strong>".  Once that is done, copy the following snippet of code and paste it into the text area.
<pre><code class="language-markup">&lt;!-- The button --&gt;
&lt;a href="#{{ widget.modal_button|replace('&amp;','and')|replace(' ','-')|replace('(','-')|replace(')','-')|replace('?','')|replace('"','')|replace("'","")|replace(".","")|replace(":","")|replace(",","") }}" class="open-popup-link"&gt;{{ widget.modal_button }}&lt;/a&gt;

&lt;!-- the modal popup is hidden until the button is clicked --&gt;
&lt;div id="{{ widget.modal_button|replace('&amp;','and')|replace(' ','-')|replace('(','-')|replace(')','-')|replace('?','')|replace('"','')|replace("'","")|replace(".","")|replace(":","")|replace(",","") }}" class="white-popup mfp-hide"&gt;
    {{ widget.modal_popup }}
&lt;/div&gt;

&lt;!-- Copy and paste your css file between the quotations in the href below --&gt;
&lt;link rel="stylesheet" href="CSS_File_URL_Goes_Here"&gt;
&lt;style&gt;
    .white-popup {
      position: relative;
      background: #FFF;
      padding: 20px;
      width: auto;
      max-width: 500px;
      margin: 20px auto;
    }
&lt;/style&gt;

&lt;!-- Copy and paste your js file between the quotations in the src below --&gt;
&lt;script src="JS_File_URL_Goes_Here"&gt;&lt;/script&gt;
&lt;script&gt;
    $(document).ready(function() {
        $('.open-popup-link').magnificPopup({
          type:'inline',
          midClick: true
        });
    });
&lt;/script&gt;</code></pre>
Now your custom module should look like this:

<img class="aligncenter size-full wp-image-510" src="https://i0.wp.com/stefenphelps.com/wp-content/uploads/2015/04/modal-popup-module-2.png?fit=800%2C435&#038;ssl=1" alt="" width="800" height="435" />

Last thing you'll need to do is upload the two files you downloaded in step one into your portal's file manager, copy each URL, and replace the placeholder text "CSS_File_URL_Goes_Here" with your Magnific-Popup.css URL and "JS_File_URL_Goes_Here" with your Magnific-Popup.js URL. Alternatively, if you're going to use more than one on a single page, you should place the CSS in your site's header and the JS scripts in your site's footer.
<h2>Step 3: Try Out Your Awesome New Modal Window Module!</h2>
Edit any page that has a flex column, and add your shiny new custom module to the page, and give the modal button a name and Voila! <em>-- If it's not working, be sure that your site has the latest version of jQuery by going to your content settings and changing the jQuery dropdown to version 1.11.x --</em> If you found this tutorial helpful let us know in the comments below and we'll write some more tutorials. <a href="http://www.bluleadz.com/modal-window-test?hs_preview=ESAfMVA1-2691250931">You can view a live demo here.</a>

