Originally posted on <a href="http://www.bluleadz.com/blog/how-to-make-a-modal-popup-custom-module-in-hubspot">Bluleadz.com</a>

I am a big fan of the way Instagram's mobile app and <a href="https://jmperezperez.com/medium-image-progressive-loading-placeholder/" target="_blank" rel="noopener">Medium</a>'s website load images. If you don't know what I'm talking about, it's when an extremely small image is scaled up, blurred out and is loaded before the full image... eventually fading into the full image once it has loaded. Like so:

<!--more-->

<img class="aligncenter" style="width: 704px;" title="Progressive Loading Image on Medium" src="http://i.giphy.com/3oz8xQJy64awXLEqyc.gif" alt="Progressive Loading Image on Medium" width="704" data-constrained="true" />

Providing visual feedback to end users — <strong>especially users with slower connections</strong> — that something is happening is a great way to improve UX. Thanks to HubSpot's <a href="https://knowledge.hubspot.com/articles/kcs_article/cos-general/what-is-automatic-image-resizing" target="_blank" rel="noopener">automatic image resizing</a> and a nifty little script by David Desandro (the man behind <a href="http://metafizzy.co/" target="_blank" rel="noopener">metafizzy</a>) it's pretty easy to achieve the same effect on your HubSpot website:

<img class="aligncenter" style="width: 704px;" title="Progressive Loading Background Image on HubSpot" src="http://i.giphy.com/3oz8xPBjyHeOct6jNS.gif" alt="Progressive Loading Background Image on HubSpot" width="704" data-constrained="true" />

<hr />

<h2>How To Create Progressive Loading Images in HubSpot</h2>
<h3><span style="color: #71bf43;">Step 1: The HubL</span></h3>
If you haven't noticed, full-width image backgrounds are all the rage in <a href="https://www.growwithsms.com/web/website-design">web design</a> these days. Because they are so large, they are the perfect candidate for this image loading technique. In HubSpot you'll need to either use a custom module or a HubL module so you can manipulate the image's <em>src</em> attribute. We are using a custom module for our headers like so:

<pre><code>&lt;div class=&quot;bg-section-header&quot;{% if widget.background_image.src %} style=&quot;background-image:url({{ widget.background_image.src }});&quot;{% endif %}&gt;
    &lt;div class=&quot;bg-section-header_placeholder&quot;{% if widget.background_image.src %} style=&quot;background-image: url({{ widget.background_image.src }}?width=20);&quot;{% endif %}&gt;&lt;/div&gt;
    &lt;h1&gt;{{ widget.header }}&lt;/h1&gt;
    &lt;p class=&quot;secondary-header&quot;&gt;{{ widget.secondary_header }}&lt;/p&gt;
&lt;/div&gt;</code></pre>

As usual, we use an inline style for the image so it can be unique on each page. The real magic happens in the child div "bg-section-header_placholder". We use the same code to display the same image, but appending the src with "?width=20". Doing this tells HubSpot's servers to resize the image to 20px using their image resizing magic.

One thing to note, HubSpot uses two different URLs for loading images. One for images that are compressed/resized<em> </em>and one for images that are not compressed/resized:
<ul>
 	<li>Doesn't resize: <em><em>example.com/<strong>hubfs</strong>/image.jpg</em></em></li>
 	<li>Does resize:<em> example.com/<strong>hs-fs/hubfs</strong>/image.jpg</em></li>
</ul>
By default, the custom module will use the URL that doesn't resize the image. To get around this you can use the "replace" HubL filter to replace the default URL like so:

<pre><code>&lt;div class=&quot;bg-section-header&quot;{% if widget.background_image.src %} style=&quot;background-image:url({{ widget.background_image.src }});&quot;{% endif %}&gt;
    &lt;div class=&quot;bg-section-header_placeholder&quot;{% if widget.background_image.src %} style=&quot;background-image: url({{ widget.background_image.src|replace('/hubfs/','/hs-fs/hubfs/') }}?width=20);&quot;{% endif %}&gt;&lt;/div&gt;
    &lt;h1&gt;{{ widget.header }}&lt;/h1&gt;
    &lt;p class=&quot;secondary-header&quot;&gt;{{ widget.secondary_header }}&lt;/p&gt;
&lt;/div&gt;</code></pre>


<strong>NOTE</strong>: if you prefer to use the default "cdn2.hubspot.com" URLs you'll need to use a different replace filter:
<pre><code>{{ widget.background_image.src|replace('/hubfs/' + hub_id, '/hub/' + hub_id + '/hubfs') }}</code></pre>
<em>Thanks Kenneth!</em>
<h3><span style="color: #71bf43;">Step 2: The CSS</span></h3>
Now just add a little CSS and you'll have your background image and the small/blurry placeholder image:

<pre><code>.bg-section-header {
    background-color: #222;
    background-position: center;
    background-size: cover;
    color: #fff;
    position: relative;
}
.bg-section-header_placeholder {
    background-color: #222;
    background-position: center;
    background-size: cover;
    opacity: 1;
    transition: opacity 400ms ease;
    position: absolute;
    top: 0;
    left: 0;
    right: 0;
    bottom: 0;
    width: 100%;
    height: 100%;
}</code></pre>
<h3><span style="color: #71bf43;">Step 3: The JavaScript</span></h3>
Now the final step is to fade out the placeholder image once the full size image loads. With the <a href="http://imagesloaded.desandro.com/">imagesLoaded</a> script, we can detect when the background image loads and create a function to change the opacity of the placeholder to 0 with this callback:

<pre><code>$('.bg-section-header').imagesLoaded( { background: true }, function() {
    $('.bg-section-header_placeholder').css('opacity','0');
});</code></pre>

<strong>Pretty cool, right?</strong>

The only downside to doing this is that you are adding an extra HTTP request to the page. However, I would argue this being a non-issue with <a href="https://http2.github.io/">HTTP/2</a> just around the corner and, in the meantime, I believe the improved UX is a tradeoff well worth the extra 50 milliseconds.

